import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    console.log("props initialised");
  }
  render() {
    return (
      <div className="App">
        <table className="titleHeader">
          <tbody>
            <tr>
              <td>
                <img
                  alt="Icon"
                  width="100"
                  src="https://api.nasa.gov/images/logo.png"
                />
              </td>
              <td width="10" />
              <td>
                <h1>NASA Images</h1>
              </td>
            </tr>
          </tbody>
        </table>
        <input
          style={{
            fontSize: 20,
            display: "block",
            width: "99%",
            paddingTop: 8,
            paddingBottom: 8,
            paddingLeft: 15
          }}
          placeholder="Type here"
        />

        <p />
      </div>
    );
  }
}

export default App;
